import React, { useState } from "react";
import PlaceGrid from "./components/PlaceGrid";

export default function App() {
  const [selected, setSelected] = useState(null);
  const [q, setQ] = useState("");

  // Places using PUBLIC images folder
  const places = [
    { id: 1, name: "Beach Paradise", image: process.env.PUBLIC_URL + "/images/beach.jpg" },
    { id: 2, name: "Mountain View", image: process.env.PUBLIC_URL + "/images/mountain.jpg" },
    { id: 3, name: "Forest Escape", image: process.env.PUBLIC_URL + "/images/forest.jpg" },
    { id: 4, name: "City Lights", image: process.env.PUBLIC_URL + "/images/city.jpg" },
    { id: 5, name: "Waterfall Point", image: process.env.PUBLIC_URL + "/images/waterfall.jpg" },
    { id: 6, name: "Lake Paradise", image: process.env.PUBLIC_URL + "/images/lake.jpg" },
    { id: 7, name: "Temple View", image: process.env.PUBLIC_URL + "/images/temple.jpg" },
    { id: 8, name: "Desert Safari", image: process.env.PUBLIC_URL + "/images/desert.jpg" },
    { id: 9, name: "Island Resort", image: process.env.PUBLIC_URL + "/images/island.jpg" },
    { id: 10, name: "Snow Valley", image: process.env.PUBLIC_URL + "/images/snow.jpg" }
  ];

  const filtered = places.filter(p =>
    (p.name || "").toLowerCase().includes(q.toLowerCase())
  );

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>

      {/* Title */}
      <h1 style={{ textAlign: "center" }}>TouristSpot</h1>

      {!selected && (
        <>
          {/* Search Row (matches your sketch) */}
          <div style={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            marginBottom: "20px"
          }}>
            <input
              value={q}
              onChange={(e) => setQ(e.target.value)}
              placeholder="Search"
              style={{
                width: "70%",
                padding: "10px",
                borderRadius: "8px",
                fontSize: "16px"
              }}
            />
            <button
              style={{
                padding: "10px 20px",
                borderRadius: "50px",
                fontSize: "16px"
              }}
            >
              Reviews
            </button>
          </div>

          {/* List heading */}
          <h3>List of Places</h3>

          {/* Grid */}
          <PlaceGrid places={filtered} onOpen={(p) => setSelected(p)} />
        </>
      )}

      {/* Detail Page */}
      {selected && (
        <div style={{ textAlign: "center" }}>
          <h2>{selected.name}</h2>
          <img
            src={selected.image}
            alt={selected.name}
            style={{ width: "300px", borderRadius: "10px" }}
          />
          <br /><br />
          <button onClick={() => setSelected(null)}>Back</button>
        </div>
      )}
    </div>
  );
}
